import React, { Component, Fragment ,useEffect} from 'react';
import ParticlesBg  from "particles-bg";
import {Link, NavLink , Route } from 'react-router-dom';
import {ImportOutlined ,ShoppingTwoTone,ShoppingCartOutlined } from '@ant-design/icons';
import { checkAuthenticated, load_user ,logout } from '../actions/auth';
import { connect } from 'react-redux';


const Header = (props , isAuthenticated , logout) => {
  useEffect(() => {
    props.checkAuthenticated();
    props.load_user();
    console.log("works")
  }, []);






    const geustLinks = (
      <Fragment>
        <li><a className="smoothscroll">login</a></li>
        <li className="smoothscroll">

        </li>
      </Fragment>
    );
    const authLinks = () => (
      <li className='nav-item'>
          <a className='nav-link' href='#!' onClick={logout}>Logout</a>
      </li>
  );



    return (
      <header id="home">
      <ParticlesBg type="circle" bg={true} />
      <nav id="nav-wrap">
         <a className="mobile-btn" href="#nav-wrap" title="Show navigation">Show navigation</a>
	      <a className="mobile-btn" href="#home" title="Hide navigation">Hide navigation</a>



         <ul id="nav" className="nav">
            <li className="current"><a className="smoothscroll" href="#home">Home</a></li>
            <li><a className="smoothscroll" href="#Shop">Products</a></li>
            <li><a className="smoothscroll" href="#about">About</a></li>
            <li><a className="smoothscroll" href="#portfolio">Works</a></li>
            <li><a className="smoothscroll" href="#contact">Contact</a></li>
            <div id="Space">
            <li id = "icon-nav"><a className="smoothscroll" href="#contact"><ShoppingCartOutlined /></a></li>
            {isAuthenticated ? geustLinks() : authLinks()}

            </div>


         </ul>

      </nav>



      <p className="scrolldown">
         <a className="smoothscroll" href="#about"><i className="icon-down-circle"></i></a>
      </p>

   </header>
    );


};
const mapStateToProps = state => ({
  isAuthenticated: state.auth.isAuthenticated
});
export default connect(mapStateToProps, { checkAuthenticated, load_user })(Header);
